import http from "k6/http";
import {check, sleep} from "k6";
import {parseHTML} from "k6/html";
import encoding from "k6/encoding";
/*
This loadtest is based on measured values of the current production system.

Average session duration in seconds         150 (2:30 min), peak: 200 (3:26 min)
Hourly sessions (peak)                      6100
Average server response time in seconds     0.67
Pages per session                           1.7

Seen realtime values in Google Analytics:
400 users online: 6   pages/seconds
77  users online: 1-2 pages/seconds


VU Calculation based on:
Virtual Users = (Hourly Sessions x Average Session Duration in seconds) / 3,600
 */
const vus = 250;
const average_sessions_duration_s = 150;
const max_response_time_ms = 670;
const test_duration_s = "300s";
const domain = "https://de.serlo-staging.dev";
const user = 'serloteam' // supply basic auth credentials here
const pass = 'serloteam'

const basicAuth = { 'Authorization': 'Basic ' + encoding.b64encode(user + ':' + pass) }

export let options = {
    vus: vus,
    duration: test_duration_s,
    insecureSkipTLSVerify: true
    // stages: [
    //     { duration: "30s", target: 20 },
    //     { duration: "1m30s", target: 10  },
    //     { duration: "20s", target: 0 },
    // ]
};

export default function () {
    sleep(Math.floor(Math.random() * (average_sessions_duration_s)));
    const page = getRandomData()
    let res = http.get(domain + page.url, {
        auth: 'basic',
        headers: basicAuth
    });
    check(res, {
        "status was 200": (r) => r.status == 200,
        "transaction time OK": (r) => r.timings.duration < max_response_time_ms
    });
    const doc = parseHTML(res.body)

    const injectionElements = doc.find('.injection a')
    const count = injectionElements.size()
    if (count) {
        let injectionUrls = []
        injectionElements.each((idx,el) => {
              injectionUrls.push(el.getAttribute('href'))
          })

        const injectionResponses = http.batch(injectionUrls.map(url => {
            return {
                method: 'GET',
                url: domain + url,
                params: {
                    auth: 'basic',
                    headers: {
                        'X-Requested-With': 'XMLHttpRequest',
                        Authorization: basicAuth.Authorization
                    }
                }
            }
        }))
        for (let i = 0; i < count; i++) {
            check(injectionResponses[i], {
                "status of injection was 200": (r) => r.status == 200,
                "injection transaction time OK": (r) => r.timings.duration < max_response_time_ms
            })
        }
    }
};

function getRandomData() {
    const random = Math.random()
    return data.find(page => page.cumulatedDistribution > random)
}

